svg.script:
window.onload = function () {

  let groupes = [
    "group00",
    "group01",
    "group02",
    "group03",
    "group04",
    "group05",
    "group06",
    "group07",
    "group08",
    "group09"
  ];

  function hideAll() {
    groupes.forEach(function (grp) {
      document.getElementById(grp).style.visibility = "hidden";
    })
  }

  var step = 0;

  function next() {
    step++;
    if (step > groupes.length) {
      step--;
    }
    groupes.slice(0, step).forEach(function (grp) {
      document.getElementById(grp).style.visibility = "visible";
    })
  }

  function previous() {
    step--;
    if (step < 0) {
      step++;
    }
    groupes.slice().reverse().slice(0, groupes.length - step).forEach(function (grp) {
      document.getElementById(grp).style.visibility = "hidden";
    })
  }

  document.getElementById("arrowNext").addEventListener("click", next);
  document.getElementById("arrowPrevious").addEventListener("click", previous);

  hideAll();
}
